import React from "react";
import { Link } from "react-router-dom";
import Auth from "../../App/Auth";
import "./Header.scss";

class Header extends React.Component {
  constructor(props) {
    super(props);
    this.login = this.login.bind(this);
    this.logout = this.logout.bind(this);
  }
  login() {
    // BT5LY EL IS AUTH B TRUE
    Auth.authenticate();
  }
  logout() {
    // BT5LY EL IS AUTH B FALSE
    Auth.signout();
  }
  render() {
    return (
      <div className="Header">
        <Link className="Header__HomeLink col-sm-3" to="/">
          Home
        </Link>
        <br />
        <Link className="Header__PublicLink col-sm-3" to="Public">
          Public
        </Link>
        <br />
        <Link className="Header__protectedLink col-sm-3" to="protected">
          Protected
        </Link>
        <br />
        <button className="btn btn-primary" onClick={this.login}>
          Login
        </button>
        <br />
        <button onClick={this.logout}>Logout</button>
      </div>
    );
  }
}
export default Header;
